		   // create the Contacts object store and indexes
		   request.onupgradeneeded = (event) => {
			   let db = event.target.result;
	   
			   // create the Contacts object store 
			   // with auto-increment id
			   let store = db.createObjectStore('tbl_rfid', {
				   autoIncrement: true
			   });
	   
			   // create an index on the email property
			   let index = store.createIndex('PACK_EPC', 'PACK_EPC', {
				   unique: false
			   });
	   
			   let index1 = store.createIndex('CC_NO', 'CC_NO', {
				   unique: false
			   });
	   
			   let index2 = store.createIndex('MC_NO', 'MC_NO', {
				   unique: false
			   });
			   let index3 = store.createIndex('SKU_CODE', 'SKU_CODE', {
				   unique: false
			   });
		   
		   
	   
	   
		   };
	   
